def compare_numbers(x1, p1, x2, p2):
    len1 = len(str(x1)) + p1
    len2 = len(str(x2)) + p2

    if len1 > len2:
        return '>'
    elif len1 < len2:
        return '<'
    else:
        # If lengths are equal, compare the numbers directly
        num1 = str(x1) + '0' * p1
        num2 = str(x2) + '0' * p2
        if num1 > num2:
            return '>'
        elif num1 < num2:
            return '<'
        else:
            return '='

def main():
    import sys
    input = sys.stdin.read
    data = input().split()

    t = int(data[0])
    index = 1
    results = []

    for _ in range(t):
        x1 = int(data[index])
        p1 = int(data[index + 1])
        x2 = int(data[index + 2])
        p2 = int(data[index + 3])
        index += 4

        result = compare_numbers(x1, p1, x2, p2)
        results.append(result)

    for result in results:
        print(result)

if __name__ == "__main__":
    main()
